import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './index.css';

class initialProfile extends Component {
	constructor(props) {
		super(props);
		this.state = {
			gender: '',
			secualPreference: '',
			biography: '',
		}
	}

	render() {
		return (
			<div>
				<div className="header">
					<div id="title">MATCH<span className="red">A</span></div>
					<Link to="/"><div id="logout">Logout</div></Link>
				</div>
				<div>Tell Us More about Yourself</div>
			</div>
		)
	}
}

export default initialProfile;
